import React, { useState, useRef } from "react";
import { useNavigate } from "react-router-dom";
import ProfileModal from "../components/ProfileModal"; // <-- import your modal here

function SellerDashboard() {
  const navigate = useNavigate();

  const [profile, setProfile] = useState({
    fullName: "John Doe",
    address: "123 Tailoring Street, City",
    phone: "+91 9876543210",
    tailoringName: "John's Tailors",
    email: "john@example.com",
    photoUrl: "https://via.placeholder.com/80"
  });

  // ... all other state and refs ...
  const [showModal, setShowModal] = useState(false);
  const [editProfile, setEditProfile] = useState(false);

  // ... all your other functions ...

  // Example usage (always after their definition above):
  return (
    <div>
      <button onClick={() => navigate("/chat")}>Go to Chat</button>
      <button onClick={() => setShowModal(true)}>Show Profile</button>
      <ProfileModal
        profile={profile}
        setProfile={setProfile}
        open={showModal}
        onClose={() => { setShowModal(false); setEditProfile(false); }}
        editable={editProfile}
        setEditable={setEditProfile}
      />
      {/* ...rest of your dashboard... */}
    </div>
  );
}

export default SellerDashboard;
